        add_theme_support('custom-logo');

        //Add CSS for Editor MCE
        add_editor_style(get_template_directory_uri().'/assets/css/editorstyle.min.css');

        // Remove version info from head and feeds (dont want to help hackers) & clean header
        remove_action('wp_head', 'wp_generator');
        remove_action('wp_head', 'wlwmanifest_link');
        remove_action('wp_head', 'rsd_link');

        // Remove the WordPress Emojis
        remove_action('wp_head', 'print_emoji_detection_script', 7);
        remove_action('admin_print_scripts', 'print_emoji_detection_script');
        add_action('wp_head', 'add_meta_security');

        // Add Excerpt for pages
        add_post_type_support('page', 'excerpt');
    }

    add_action('after_setup_theme', 'avatar_theme_setup');
}

