// get primary category
if (! function_exists('get_primary_category')) {

    function get_primary_category($category)
    {
        $useCatLink = true;
        // If post has a category assigned.
        if ($category) {
            $category_display = '';
            $category_link = '';
            if (class_exists('WPSEO_Primary_Term')) {
                // Show the post's 'Primary' category, if this Yoast feature is available, & one is set
                $wpseo_primary_term = new WPSEO_Primary_Term('category', get_the_id());
                $wpseo_primary_term = $wpseo_primary_term->get_primary_term();
                $term = get_term($wpseo_primary_term);
                if (is_wp_error($term)) {
                    // Default to first category (not Yoast) if an error is returned
                    $category_display = $category[0]->name;
                    $category_link = get_category_link($category[0]->term_id);
                } else {
                    // Yoast Primary category
                    $category_display = $term->name;
                    $category_link = get_category_link($term->term_id);
                }
            } else {
                // Default, display the first category in WP's list of assigned categories
                if (! is_object($category[0])) {
                    $category[0] = get_term($category[0]);
                }
                $category_display = $category[0]->name;
                $category_link = get_category_link($category[0]->term_id);
            }
            // Display category
            if (! empty($category_display)) {
                if ($useCatLink == true && ! empty($category_link)) {
                    return ''.htmlspecialchars($category_display).'';
                } else {
                    return ''.htmlspecialchars($category_display).'';
                }
            }
        }
    }
}

if (! function_exists('get_primary_category_origin')) {
    function get_primary_category_origin($categorie_list)
    {
        return get_field(
            'acf_category_site_origin',
            get_category(
                get_cat_ID(
                    html_entity_decode(get_primary_category($categorie_list), ENT_QUOTES, 'UTF-8')
                )
            )
        );
    }
}

if (! function_exists('get_category_origin')) {
    function get_category_origin($category)
    {
        return get_field(
            'acf_category_site_origin',
            $category
        );
    }
}

function is_cir_section()
{
    return get_current_view_context() == 'cir';
}

function get_current_view_context()
{
    $current_url = 'https://'.$_SERVER['HTTP_HOST'].$_SERVER['REQUEST_URI'];
    //If current URL contains 'canadian-investment-review' or '/news/cir-news-news/' we are in 'cir'
    if (strpos($current_url, 'canadian-investment-review') !== false || strpos($current_url, '/news/cir-news-news/') !== false || strpos($current_url, '/microsite/microsite-cir/') !== false) {
        return 'cir';
        //If current URL contains 'benefitscanada.com' we are in 'bencan'
    } elseif (strpos($current_url, 'benefitscanada.com') !== false) {
        return 'bencan';
        //If current URL contains 'avantages.ca' we are in 'ava'
    } elseif (strpos($current_url, 'avantages.ca') !== false) {
        return 'ava';
        //No default fallback
    } else {
        return false;
    }
}

